import React from "react";
import "../styles/pages/properties.scss";
import { NavLink } from "react-router-dom";

const Properties = ({ pic, title, desc, price, svg }) => {
  return (
    <div className="content">
      <div className="img">
        <img src={pic} alt="property" />
      </div>
      <div>
        <div className="item">
          <h1> {title} </h1>
          <p> {desc} </p>
        </div>
        <div className="price">
          <p>
            From $ <span>{price}</span> /Nigth
          </p>
          <NavLink to="" className="button">
            {svg}
          </NavLink>
        </div>
      </div>
    </div>
  );
};

export default Properties;
